import React from 'react';
import ReactDOM from 'react-dom';
import Coverflow from 'react-coverflow';
import { StyleRoot } from 'radium';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';

const styles = {
  card: {
  },
  media: {
    height: 140,
  },
}

class PortfolioCarousel extends React.Component {

  render(){
    return(
      <div>
        <StyleRoot>
          <Coverflow
            displayQuantityOfSide={2}
            navigation
            infiniteScroll={false}
            enableHeading ={false}
            media={{
              '@media (max-width: 900px)': {
                width: '100%',
                height: '300px'
              },
              '@media (min-width: 900px)': {
                width: '100%',
                height: '600px'
              }
            }}
          >
            <Card style={styles.card}>
              <CardActionArea>
                <CardMedia
                  style={styles.media}
                  image="/../assets/background1.png"
                  title="Contemplative Reptile"
                />
                <CardContent>
                  <Typography gutterBottom variant="h5" component="h2">
                    Lizard
                  </Typography>
                  <Typography component="p">
                    Lizards are a widespread group of squamate reptiles, with over 6,000 species, ranging
                    across all continents except Antarctica
                  </Typography>
                </CardContent>
              </CardActionArea>
              <CardActions>
                <Button size="small" color="primary">
                  Share
                </Button>
                <Button size="small" color="primary">
                  Learn More
                </Button>
              </CardActions>
            </Card>
            <img src='../assets/images/background1.png'data-action="https://facebook.github.io/react/"/>
            <img src='images/album-2.png' alt='Album two' data-action="http://passer.cc"/>
            <img src='images/album-3.png' alt='Album three' data-action="https://doce.cc/"/>
            <img src='images/album-4.png' alt='Album four' data-action="http://tw.yahoo.com"/>
          </Coverflow>
        </StyleRoot>
      </div>
    )
  }
}


export default PortfolioCarousel;
